import { Typography } from '@mui/material';
import { Box } from '@mui/system';
import {useSelector} from 'react-redux'

export default function Cart(){
    const cartList = useSelector((state)=>state.cart.cartList);
    return(
        <>
            <Box>
                Order Details:
                {
                    cartList.map((item)=>{
                        return(
                            <Typography>
                                {item.name}
                            </Typography>
                        )
                    })
                }
            </Box>
        </>
    )
}
